import React from 'react';
import data from '../data';
import TableItem from './table-item'

import './table.css';

const Table = () => {

    const items = data.map(item => {
        return (<TableItem {...item}/>)
    });

    return (
        <table>
            <tr>
                <td className='boldName'>name</td>
                <td className='boldName'>height</td>
                <td className='boldName'>mass</td>
                <td className='boldName'>hair color</td>
            </tr>

                {items}

        </table>
    )

}


export default Table;
